// src/stores/user.store.js

import { action, autorun, comparer, computed, get, makeAutoObservable } from "mobx";
import { RootStore } from ".";

class userStore {
    name = "Example-React";
    rootStore: RootStore;

    constructor(rootStore: RootStore) {
        this.rootStore = rootStore;
        makeAutoObservable(this);
        autorun(()=>{
            
            console.log('abc');
            console.log('abc');
            console.log('abc');
        })
    }

    setUserName = (name: string) => {
        this.name = name;
    };

    get getUsername() {
        return this.name
    }
}

export default userStore;
